        <div className="container">
          <h2 className="font-SoraRegular text-5xl/[56px] tracking-tighter text-center mb-10">
            My <span className="font-SoraExtraBold">Projects</span>
          </h2>
          <div>
            <img src="./image/svg/project-img-3.svg" alt="" />
            <div>
                <h4>01</h4>

            </div>
          </div>
        </div>
      </section>
    </>
  );
}
